@csrf_exempt
def add_admin(request):
    # if user is not an admin or isnt authenticated-> login
    if not request.user.is_authenticated or request.user.username != "admin":
        return redirect("login")

    if request.method == 'POST':
        form = AddAdmin(request.POST, request.FILES)
        if form.is_valid():
            # get info form form
            form_data = form.cleaned_data
            first_name = form_data["first_name"]
            last_name = form_data["last_name"]
            contact = form_data["contact"]
            email = form_data["email"]
            photo = form_data["photo"]
            birth_date = form_data["birth_date"]
            nif = form_data["nif"]

            if photo != None:
                photo_b64 = base64.b64encode(photo.file.read())
                photo_b64 = photo_b64.decode()
            else:
                photo_b64 = ""

            # check for unique constraints

            if list(User.objects.filter(username=email)) != []:
                error_message = "There is already a user with this email! The admin WASN'T added to database!"
                return render(request, "add_admin.html",
                              {'form': form, "state": "error", "state_message": error_message})

            if list(Person.objects.filter(nif=nif)) != []:
                error_message = "There is already a user with this nif! The admin WASN'T added to database!"
                return render(request, "add_admin.html",
                              {'form': form, "state": "error", "state_message": error_message})

            # create a user
            u = User.objects.create_user(username=email, first_name=first_name, last_name=last_name, password='pw')
            u.save()

            # link the user to a person
            p = Person.objects.create(user=u, contact=contact, nif=nif, birth_date=birth_date, photo_b64=photo_b64)
            p.save()

            # check if the group admins exists, else create it
            # finally add admin to group
            admins_group = list(Group.objects.filter(name='admins_group'))

            if len(admins_group) == 0:
                admins_group = Group.objects.create(name='admins_group')
                admins_group.save()

            admins_group = Group.objects.get(name='admins_group')
            admins_group.user_set.add(u)

            form = AddAdmin()

            state_message = "The admin was added to database"
            return render(request, "add_admin.html",
                          {'form': form, "state": "success", "state_message": state_message})
        else:
            print("Invalid form")
    else:
        form = AddAdmin()
    return render(request, "add_admin.html", {'form': form})


